import React from "react";
import { Fragment } from "react/cjs/react.production.min";
import Logo from "../logo/logo";
import './footer.css';

const Foot=()=>{
return(
    <Fragment>
        <div className="foot_container">
            <div className="services">
                <div className="service_head">Services</div>
                <ul>
                    <li><a>Web Design</a></li>
                    <li>Web Development</li>
                    <li>Website Maintenance</li>
                </ul>
            </div>
            <div className="copyrights"><p>Created by Priyansh Gupta. &copy;2022 Copyrights Reserved</p>
            </div>
            <div className="Arrow_up"><span className="icon"><ion-icon name="chevron-up-circle-outline"></ion-icon></span></div>
        </div>
    </Fragment>
    );
};

export default Foot;
